import axios from 'axios';

const basePath = 'http://localhost:8080/foods';

export const saveFood = (
    id,
    name,
    weight,
    proteinPer100g,
    fatsPer100g,
    kcalPer100g,
    proteinTotal,
    fatsTotal,
    kcalTotal
) => {
    const dto = {
        id: id,
        name: name,
        weight: weight,
        proteinPer100g: proteinPer100g,
        fatsPer100g: fatsPer100g,
        kcalPer100g: kcalPer100g,
        proteinTotal: proteinTotal,
        fatsTotal: fatsTotal,
        kcalTotal: kcalTotal
    }


    return axios.post(basePath + `/add`, dto);
}

export const getAll = () => {
    return axios.get(basePath + '/all');
}

function makeDTO(id, name, weight, proteinPer100g, fatsPer100g, kcalPer100g, proteinTotal, fatsTotal, kcalTotal) {
    return {
        id: id,
        name: name,
        weight: weight,
        proteinPer100g: proteinPer100g,
        fatsPer100g: fatsPer100g,
        kcalPer100g: kcalPer100g,
        proteinTotal: proteinTotal,
        fatsTotal: fatsTotal,
        kcalTotal: kcalTotal
    };
}
